import React from "react";
import Item from "./Item"

const ItemList=({img})=> {

    const renderList=img.map(img=>{
        return <Item img={img} />
    })
        return(
            <div className="row">
                {renderList}
                <ItemDetails />
                <ItemInfo />
            </div>
        )

 }

 export default ItemList;
